function Choix() {
    

  let history = useHistory();
    return (
        <div className="choix">
        
        
     <p> Veuillez choisir un style de cartes </p> 
        
     
<div className="calquesdeschoix">


<div className="premier" onClick={() => {
                history.push(`/form`);
              }}>
      <img src={model} /> 
      
      <p>Les animaux</p>
       </div>



       <div className="deuxieme" onClick={() => {
                history.push(`/form2`);
              }}>
      <img src={model2} /> 
      
      <p>Illustrations</p>
       </div>

       <div className="troisieme" onClick={() => {
                history.push(`/form3`);
              }}>
      <img src={model3} /> 
      
      <p>Tarots de Marseille</p>
       </div>
    
       </div>






          



        
        
        
     
         </div>
      
    );
  }
  
  export default Choix;
